import React from 'react';
import TextField from '@material-ui/core/TextField';

function Textfield(){
    return <TextField
    name="email"
    variant="outlined"
    margin="normal"
    required
    fullWidth
    id="email"
    label="Email Address"
    autoComplete="email"
    autoFocus
  />
}

export default TextField;
